/* eslint-disable jsx-a11y/anchor-is-valid */
import './App.css';
import React from 'react';


import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Navbar from './components/Navbar';


import logo1 from './images/image.jpg';
import logo2 from './images/imageb.jpg';
import logo3 from './images/imagec.jpg';

import About from './components/About';
import Service from './components/Service';

function App() {

  return (
    <>

      <Router>
        <Navbar />
        <About />
        <Service />

        <Routes>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/service">
            <Service />
          </Route>

        </Routes>
      </Router>




      <div className="background">
        <div className="content">
          <h1>Welcome to My Website</h1>
          <p>Follow me on social media:</p>
          <a href="https://twitter.com/mytwitter" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-twitter"></i>
          </a>
        </div>
      </div>

      <div
        style={{
          backgroundImage: `url(${logo1})`,
          backgroundSize: '1297px',
          backgroundAttachment: 'fixed',
          height: '100vh',
          position: 'relative',
          /* other CSS styles */
        }}
      >
        <h1>My component with inline background image</h1>
      </div>

      <div className="container2"
        style={{
          backgroundImage: `url(${logo2})`,
          backgroundSize: '1297px',
          backgroundAttachment: 'fixed',
          height: '100vh',
          position: 'relative',
          /* other CSS styles */
        }}
      >
        <img src="images/imageb.jpg" alt="" />
      </div>

      <div
        style={{
          backgroundImage: `url(${logo3})`,
          backgroundSize: '1297px',
          backgroundAttachment: 'fixed',
          height: '100vh',
          position: 'relative',
          /* other CSS styles */
        }}
      >
        <h1>My component with inline background image</h1>
      </div>





    </>
  );
};



export default App;
